pragma solidity >= 0.7.0 < 0.9.0;

import "@openzeppelin/contracts/access/Ownable.sol";

contract OwnableImplementation is Ownable {
    function accessibleForAll() public pure returns(string memory) {
        return 'all good for all';
    }

    function onlyForOwner() public view onlyOwner returns(string memory) {
        return "only owner";
    }

}
